CREATE TABLE EmployeeSurvey (employee_id INT, satisfaction_level FLOAT, department VARCHAR(50));
CREATE TABLE SurveyResponses (response_id INT, employee_id INT, question_id INT, answer VARCHAR(255));
CREATE TABLE Employees (employee_id INT, first_name VARCHAR(50), last_name VARCHAR(50), department VARCHAR(50));
CREATE TABLE Departments (department_id INT, department_name VARCHAR(50));
CREATE TABLE SurveyQuestions (question_id INT, question_text TEXT);
